const Products = () => {
	return (
		<section>
			<h1>Products page</h1>
			<ul>
				<li>
					<Link to="/products/p1">A book</Link>
				</li>
				<Link to="/products/p2">
					<li>A carpet</li>
				</Link>
				<li>An online course</li>
			</ul>
		</section>
	)
}
export default Products;
